import { Parallax } from "react-parallax";
import {Link} from "react-router-dom";
import Slider from "react-slick";
import { slickDot } from "../page-demo/script";
import Form from 'react-bootstrap/Form';
import Header from "../component/header/Header";
import { FiCast , FiLayers , FiUsers , FiMonitor ,FiChevronUp } from "react-icons/fi";
import axios from "axios";
import CounterOne from "../elements/counters/CounterOne";
import Testimonial from "../elements/Testimonial";
import InputGroup from 'react-bootstrap/InputGroup';
import BrandTwo from "../elements/BrandTwo";
import FooterTwo from "../component/footer/FooterTwo";
import ScrollToTop from 'react-scroll-up';
import Helmet from "../component/common/Helmet";
import AboutTwo from "../component/HomeLayout/homeOne/AboutTwo";
import Button from 'react-bootstrap/Button';
import PortfolioList from "../elements/portfolio/PortfolioList";
const image1 =
  "/assets/images/bg/paralax/black.jpg";
const logo = "/assets/images/medialab/logo183.png"

const ServiceLists = [
    {
        icon: <FiCast />,
        title: 'Медиа салбарын тоймыг хүргэх',
        description: 'Дэлхийн болон монголын медиа салбарын тоймыг долоо хоног бүрийн даваа гарагийн өглөө 06:30 цагт и-мейлээр хүргэнэ.Товхимолд бүртгүүлэх-энд линк холбоод товхимол бүртгүүлэх хэсэг рүү үсрэнэ.'
    },
    {
